import React from "react";
import './CartItem.css';

const CartItem = ({name, img, price, quantity}) => {
  return (
    <div className="CartItem">
      <h4>{name}</h4>
      <img src={img} width="200" />
      <ul>
        <li>Price: ${price}</li>
        <li>Quantity {quantity}</li>
        <li>Subtotal: ${price * quantity}</li>
      </ul>
    </div>
  );
};

export { CartItem };
